import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Campo1 from './src/pages/Cadastro/campo1';
import Campo2 from './src/pages/Cadastro/campo2';
import Campo3 from './src/pages/Cadastro/campo3';

const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Campo1"> {/* Aqui corrigido para "Campo1" */}
        <Stack.Screen name="Campo1" component={Campo1} />
        <Stack.Screen name="Campo2" component={Campo2} />
        <Stack.Screen name="Campo3" component={Campo3} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
